import { Button } from 'primereact/button';
import react from "react";
import "./index.css";

function App(){

    return(
        <div className='mainDiv'> 
        <div className='header'>
            <div className='logoDiv'><img className="logo" src='https://shorturl.at/cw347'/></div>
            <div className='menu'>
            <a href='https://www.yueco.edu.mm/registration/' className='menuItem'>Home</a>
            <a href='https://www.yueco.edu.mm/about-yueco/' className='menuItem'>Student Registration</a>
            <a href='https://www.yueco.edu.mm/about-yueco/' className='menuItem'>Acodemic Departments</a>
            <a href='https://www.yueco.edu.mm/about-yueco/' className='menuItem'>News</a>
            <a href='https://www.yueco.edu.mm/about-yueco/' className='menuItem'>Contact</a>
            </div>
        
        
      
       </div>
      
       
       </div>
     
    );

};



export default App;
